(88324, 172779, 7276, 2, '濃妝', '2.濃妝\n美麗的背後，是心酸堆砌的堅牆，冷靜的身後，是心碎凝結的倔強。化了一身濃妝，該學會對愛武裝？抑或是對過去偽裝？一首口是心非的悲情主打歌曲，由知名製作人何俊明老師創作，以淒冷抑鬱的弦樂鋪陳進歌，飄邈的電吉他奏鳴孤獨的殘響，空心洞穿的琴音道盡難以平復的憂傷，末段副歌電吉他與鼓重擊轟炸，傾瀉洪荒氾濫般的濃烈情感，曲終淪於涓滴的悵然。也是整張專輯錄音耗時最久的作品。繼「一千萬次的淚水」後，又一首崩潰系高難度KTV傳唱金曲。\n', '2014-09-23 00:00:00', 2000, 19, 0, 4, '濃妝詞曲 何俊明\n\n我已經投降關於你的荒唐\n我已經不再恐懼寂寞受傷\n\n你給的願望我不再奢望\n你緊握不放只是為了你的渴望\n\n我學會一個人慢慢療傷\n也學會對於你的抵抗\n\n我的淚決定不再釋放\n也會努力推開我心裡的牆\n\n我化了一身濃妝告訴你我還堅強\n泛紅的眼眶從現在開始學會了隱藏\n\n我化了一身濃妝換上美麗的模樣\n有一個天堂等著我展開翅膀去飛翔\n\n我已經投降關於你的荒唐\n我已經不再恐懼寂寞受傷\n\n你給的願望我不再奢望\n你緊握不放只是為了你的渴望\n\n我學會一個人慢慢療傷\n也學會對於你的抵抗\n\n我的淚決定不再釋放\n也會努力推開我心裡的牆\n\n我化了一身濃妝告訴你我還堅強\n泛紅的眼眶從現在開始學會了隱藏\n\n我化了一身濃妝換上美麗的模樣\n有一個天堂等著我展開翅膀去飛翔\n\n我化了一身濃妝告訴你我還堅強\n泛紅的眼眶從現在開始學會了隱藏\n\n一身濃妝換上美麗的模樣\n有一個天堂等著我展開翅膀去飛翔\n', '', 284, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-10-21 18:12:10', '2015-03-12 14:14:33', '0000-00-00 00:00:00'),
