(88362, 172779, 7276, 3, '都給我快樂', '3.都給我快樂\n都給我快樂，快樂都給我！青春熱血的一首美式搖滾快歌，奔放直入的電吉他加上急速180的鼓節奏衝撞，來不及喘息的樂浪襲捲而來，朱靜俐略帶沙啞亢進的狂野聲線，無極限的飆高音吶喊，直白不轉彎的口語歌詞，加上群眾呼喊的合聲口號，令人不自覺跟著甩頭，加大音量一起跳躍！煩惱什麼？龜毛什麼？廢話太多！快樂給我！十足熱力破錶的一首超級搖滾氣氛High歌！\n', '2014-09-23 00:00:00', 2000, 19, 0, 4, '都給我快樂詞曲 天才\n\n抱歉這不是一首情歌\n今天我們要拼命快樂\n眼淚不流行了汗水才是我們\n\n我說DJ（播音員）不要再停了\n用全力播放我的快樂\n管他生日快樂新年快樂 我只要快樂\n\n幹什麼 幹什麼 煩惱那麼得多\n為什麼 為什麼 龜毛那麼得多\n怕什麼 怕什麼 廢話不要太多 全部交給我\n\n跟著我快快快快樂的唱著 不唱抒情歌\n這樣就對了這樣就對了只差你一個\n\n跟著我跳跳跳跳起來附和 High（嗨）翻這一刻\n什麼都對了什麼都對了\n想太多 不可能\n\n哎喲都西元幾年了\n你還在唱著悲情的歌\n眼淚都不值得微笑才是真的\n\n音樂通通開到最大聲\n用全力Rock N'' Roll（搖滾）的快樂\n管他聖誕快樂分手快樂都給我快樂\n\n幹什麼 幹什麼 煩惱那麼得多\n為什麼 為什麼 龜毛那麼得多\n怕什麼 怕什麼 廢話不要太多 全部交給我\n\n跟著我快快快快樂的唱著 不唱抒情歌\n這樣就對了這樣就對了只差你一個\n\n跟著我跳跳跳跳起來附和 High（嗨）翻這一刻\n什麼都對了什麼都對了\n想太多 不可能 \n\n跟著我快快快快樂的唱著 不唱抒情歌\n這樣就對了這樣就對了只差你一個\n\n跟著我跳跳跳跳起來附和 High（嗨）翻這一刻\n什麼都對了什麼都對了\n就別想太多 \n\n跟著我快快快快樂的唱著 不唱抒情歌\n這樣就對了這樣就對了只差你一個\n\n跟著我跳跳跳跳起來附和 High（嗨）翻這一刻\n什麼都對了什麼都對了\n想太多 不可能 給我快樂\n', '', 223, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-10-21 18:13:13', '2015-03-12 14:14:34', '0000-00-00 00:00:00'),
