(88395, 172779, 7276, 4, '我們在同一個頻率〈偶像劇(再說一次我願意)插曲〉', '4.我們在同一個頻率 / 偶像劇「再說一次我願意」插曲\n由老鷹音樂創作新人玩酷男聲「陳彥允」，為師姐朱俐靜量身定做，新時代男女對唱之甜蜜情歌。首創男女同步演唱不同旋律線的聲部，多變的調性層層疊進，雙聲道呼應相輔相成，天衣無縫的契合度令人驚豔。當我們在同一個頻率，讓我收聽你的微笑，讓你感應我的心跳。當紳士遇見淑女，當我遇見了你，這就是最完美的劇情。\n', '2014-09-23 00:00:00', 2000, 19, 0, 4, '我們在同一個頻率　　詞／曲陳彥允\n女：你慢慢的靠近　紳士般的小心翼翼\n　　心跳加速的距離　我屏住了呼吸\n男：你微笑的表情　不經意溫暖了寒冷的冬季\n　　我刻意故作鎮定　注視著你眼睛\n合：我喜歡你眼神裡透露的純白色氣息	\n　　太大意臉頰不爭氣（男：身體太僵硬）洩漏了秘密\n男：我們在同一個頻率　呼吸同樣的空氣\n女：　　　同一個頻率呼吸\n男：故事情節裡愛上了他稚氣的表情\n女：紳士遇見淑女　稚氣的表情\n\n女：我們在同一個頻率　收聽著愛的旋律\n男：　　　同一個頻率收聽\n女：拉近了距離從此以後不再孤寂我遇見了你\n男：貼心不留痕跡　　　　　不再孤寂　我遇見了你\n\n女：你慢慢的靠近　紳士般的小心翼翼\n　　心跳加速的距離　我屏住了呼吸\n男：你微笑的表情　不經意溫暖了寒冷的冬季\n女：溫暖了寒冷的冬季\n男：我刻意故作鎮定　注視著你眼睛\n女：你眼睛\n合：我喜歡你眼神裡透露的純白色氣息	\n　　太大意身體太僵硬（女：臉頰不爭氣）洩漏了秘密\n\n男：我們在同一個頻率　呼吸同樣的空氣\n女：　　　同一個頻率呼吸\n\n男：故事情節裡愛上了他稚氣的表情\n女：紳士遇見淑女　稚氣的表情\n\n女：我們在同一個頻率　收聽著愛的旋律\n男：　　　同一個頻率收聽\n女：拉近了距離從此以後不再孤寂我遇見了你\n男：貼心不留痕跡　　　　　不再孤寂　我遇見了你\n\n女：我遇見你男：遇見了你\n', '', 241, '', '', '', '', '福茂唱片LINFAIR RECORDS', '', 0, 1, 0, '2014-10-21 18:14:06', '2015-03-12 14:14:35', '0000-00-00 00:00:00'),
